import http from '@core/services/http'
import { buildQueryString } from '@core/utils/url'

export default {
  /**
   * Fetch container
   * @param payload
   * @return {*}
   */
  creatVideoPreview(payload) {
    return http.post("/create-video-preview",payload)
  },
}
